function genOffers(out, offer, minObj, maxObj, i) {
  if (i === MAX_TYPES) {
    let sum = 0;
    for (const count of offer) {
      sum += count;
    }
    if (sum > maxObj) {
      return;
    }
    out.push(offer.slice());
    return;
  }

  for (let j = 0; j <= maxObj; j++) {
    offer[i] = j;
    genOffers(out, offer, minObj, maxObj, i + 1);
  }
}

